import React, { useEffect, useState } from 'react';
import '../Components/Styles/Login.css';

const Form = (props) => {
  return (
    <form>
      <input
        onChange={(e) => props.setEmail(e.target.value)}
        className="input"
        placeholder="E-mail"
      ></input>
      <input
        onChange={(e) => props.setPassword(e.target.value)}
        className="input"
        placeholder="Senha"
      ></input>
      <input
        onChange={(e) => props.setPasswordConfirmation(e.target.value)}
        className="input"
        placeholder="Confirmar senha"
      ></input>
      <span onClick={() => props.setRegistry(false)} className="registry">
        Voltar para o inÃ­cio
      </span>
      <button className="button-form" className="button-form">
        Cadastrar
      </button>
    </form>
  );
};

export default Form;
